import { createTheme } from "@mui/material";

const defaultTheme = createTheme({
  palette: {
    primary: {
      main: "#18affe",
      contrastText: "#ffffff",
    },
    secondary: {
      main: "#DAA520",
      contrastText: "#fff",
    },
  },
});

export default defaultTheme;
